// src/components/SpeedsDisplay.js
import React, { useEffect, useState } from 'react';

const SpeedsDisplay = () => {
    const [speeds, setSpeeds] = useState([]);

    useEffect(() => {
        fetch('http://127.0.0.1:5000/traffic_speeds')
            .then(response => response.json())
            .then(data => setSpeeds(data));
    }, []);

    return (
        <div>
            <h2>Traffic Speeds</h2>
            <ul>
                {speeds.map(speed => (
                    <li key={speed.id}>{`ID: ${speed.id}, Speed: ${speed.speed}`}</li>
                ))}
            </ul>
        </div>
    );
};

export default SpeedsDisplay;
